package trial;

/**
 * prefix string is also the suffix string
 * eg: happydonghappy
 * happy prefix = happy
 */
public class HappyPrefix {
    public static void main(String []sdskds){
        System.out.println(longestPrefix(""));
    }

    public static String longestPrefix(String s) {
        if(s == null || s.isEmpty())
            return "";
        String longestPrefix = "";
        StringBuilder prefix = new StringBuilder();
        for(int i=0; i<s.length()-1; i++){
            prefix.append(s.charAt(i));
            if(prefix.toString().equals(s.substring(s.length()-prefix.length()))){
                longestPrefix = prefix.toString();
            }
//            if(s.endsWith(prefix.toString())){
//                longestPrefix = prefix.toString();
//            }
        }
        return longestPrefix;
    }

}
